export default function List({emails}) {
    return (
        <div>  
            <ul>
            {emails.map(emails => (
                <li key={contact.id}>
                    Name:
                       <span>{emails.message}</span>
                    Phone: 
                       <span>{emails.tel}</span>
                </li>   
            ))}
            </ul>
        </div>
    )
}
